import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Update cart item quantity
    await page.waitForSelector('.cart'); // Wait for cart to be visible
    await page.click('.cart'); // Click on the cart to open it
    await page.waitForSelector('.cart-item'); // Wait for cart items to load

    // Assuming we want to update the quantity of the first item in the cart
    await page.waitForSelector('.cart-item'); // Ensure cart items are loaded
    await page.click('.cart-item:first-child .quantity-btn:nth-of-type(2)'); // Click '+' button to increase quantity
    await page.waitForTimeout(500); // Wait for a brief moment to allow the UI to update

    // Take screenshot after updating quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_quantity_updated.png'));

    return {
      success: true,
      action: "Updated cart item quantity",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
